import React from 'react';

function Players(props) {
    const allPlayers = props.allPlayers
    const playerList = allPlayers.map((player) =>
        <li key={player}>{player}</li>
    );
    return (
        <div>
            {playerList}
        </div>
    );
}

export default Players;
